import React, { useState, useEffect, useRef } from "react";
import { Link, Element } from "react-scroll";
import logo from "../assets/img/logo.png";
import {
  AiOutlineCodeSandbox,
  AiOutlineSlackSquare,
  AiOutlineSlack,
} from "react-icons/ai";

export default function Header() {
  const [toggle, setToggle] = useState(false);
  const menuRef = useRef(null);

  // Close the menu when a click occurs outside the menu area
  const handleDocumentClick = (e) => {
    if (toggle && menuRef.current && !menuRef.current.contains(e.target)) {
      setToggle(false);
    }
  };

  useEffect(() => {
    document.addEventListener("click", handleDocumentClick);

    return () => {
      document.removeEventListener("click", handleDocumentClick);
    };
  }, [toggle]);

  return (
    <div className="header-container max-w-[1200px] mx-auto p-3 bg-[#d0dddd5d] sticky top-0 flex justify-between items-center duration-300 shadow-2xl rounded-br-3xl rounded-bl-3xl">
      <a href="/">
        <div className="logo border-[#61dafb] border-2 rounded-lg">
          <img src={logo} className="h-[50px]" alt="Logo" />
        </div>
      </a>
      {toggle ? (
        <AiOutlineSlack
          onClick={() => setToggle(!toggle)} // Close the menu
          className="md:hidden block text-[40px] text-[#59d8e9]"
        />
      ) : (
        <AiOutlineSlackSquare
          onClick={() => setToggle(!toggle)} // Open the menu
          className="md:hidden block text-[40px] text-[#59d8e9]"
        />
      )}

      <ul
        ref={menuRef}
        className="hidden md:flex text-white  justify-center items-center flex-row gap-5 text-[16px] font-bold"
      >
        <li className="hover:scale-110 duration-300 ease-in-out hover:text-[#59d8e9]">
          <Link to="main" spy={true} smooth={true} offset={-70} duration={500}>
            Home
          </Link>
        </li>
        <li className="hover:scale-110 duration-300 ease-in-out hover:text-[#59d8e9]">
          <Link to="about" spy={true} smooth={true} offset={-70} duration={500}>
            About Me
          </Link>
        </li>
        <li className="hover:scale-110 duration-300 ease-in-out hover:text-[#59d8e9]">
          <Link
            to="experience"
            spy={true}
            smooth={true}
            offset={-70}
            duration={500}
          >
            Experience
          </Link>
        </li>
        <li className="hover:scale-110 duration-300 ease-in-out hover:text-[#59d8e9]">
          <Link
            to="Project"
            spy={true}
            smooth={true}
            offset={-70}
            duration={500}
          >
            Project
          </Link>
        </li>
        <li className="hover:scale-110 duration-300 ease-in-out p-2 bg-[white] rounded-2xl text-[black] hover:text-[#59d8e9]">
          <a href="">Resume</a>
        </li>
      </ul>

      <ul
        className={`md:hidden text-black fixed w-[100%] h-[100%] top-20 bg-white justify-center items-center flex-row gap-5 text-[16px] font-bold ${
          toggle ? "left-[0]" : "left-[-100%]"
        }`}
      >
        <li className="p-3 hover:scale-110 duration-300 ease-in-out justify-center flex hover:text-[#59d8e9]">
          <Link to="main" spy={true} smooth={true} offset={-70} duration={500}>
            Home
          </Link>
        </li>
        <li className="p-3 hover:scale-110 duration-300 ease-in-out justify-center flex hover:text-[#59d8e9]">
          <Link to="about" spy={true} smooth={true} offset={-70} duration={500}>
            About Me
          </Link>
        </li>
        <li className="p-3 hover:scale-110 duration-300 ease-in-out justify-center flex hover:text-[#59d8e9]">
          <Link
            to="experience"
            spy={true}
            smooth={true}
            offset={-70}
            duration={500}
          >
            Experience
          </Link>
        </li>
        <li className="p-3 hover:scale-110 duration-300 ease-in-out justify-center flex hover:text-[#59d8e9]">
          <Link
            to="Project"
            spy={true}
            smooth={true}
            offset={-70}
            duration={500}
          >
            Project
          </Link>
        </li>
        <li className="p-3 hover:scale-110 duration-300 ease-in-out justify-center flex bg-[white] rounded-2xl text-[black] hover:text-[#59d8e9]">
          <a href="">Resume</a>
        </li>
      </ul>
    </div>
  );
}
